(8, 7, 10, 0, 1, '<p>Which scientist popularized the theory of evolution</p>', '', '2021-07-31 03:29:31', 630, '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<answers random=\"true\"><answer id=\"6104c39bd3f983.49913032\">Isaac Newton</answer><answer id=\"6104c39bd3faa7.18205496\" correct=\"true\">Charles Darwin</answer><answer id=\"6104c39bd3fb63.54885519\">Amy Sanders</answer><answer id=\"6104c39bd3fc38.40498376\">Bill Gates</answer></answers>\n', '1.00', 0, '', 0, 0, '0.00', 0),
(9, 8, 12, 0, 1, '<p>The first computer was programmed using_______________</p>', '', '2021-07-31 03:16:42', 630, '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<answers random=\"true\"><answer id=\"6104c09a899147.17873750\">Assembly language</answer><answer id=\"6104c09a899264.45228154\" correct=\"true\">Machine language</answer><answer id=\"6104c09a899326.73479393\">Spaghetti code</answer><answer id=\"6104c09a8993e8.83690119\">Source code</answer></answers>\n', '1.00', 0, '', 0, 0, '0.00', 0),
(10, 9, 12, 0, 1, '<p>A _______ is a software program used to view Web pages.</p>', '', '2021-07-31 03:18:05', 630, '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<answers random=\"true\"><answer id=\"6104c0ed4a1662.33567063\">host</answer><answer id=\"6104c0ed4a1784.07059612\" correct=\"true\">browser</answer><answer id=\"6104c0ed4a1840.79660679\">link</answer><answer id=\"6104c0ed4a1900.36992614\">site</answer></answers>\n', '1.00', 0, '', 0, 0, '0.00', 0),
